'use strict';
({params, imports}) => {
    const _ = imports.lodash;
    return params.db.objects('ProgramEnrolment')
        .filtered(`
            voided = false 
            AND individual.voided = false 
            AND program.name = 'CSA' 
            AND programExitDateTime = null 
            AND SUBQUERY(observations, $observation, 
                $observation.concept.uuid = '97f801a6-343b-4d03-a1d5-fc80c4e01035' 
                AND $observation.valueJSON CONTAINS 'd77e23f0-8337-40ca-a3f4-fa616ccc4279'
            ).@count > 0`)
        .map(enrl => enrl.individual);    
};

